import React from "react";

const MediaLibrary = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800 amiri-font mb-6">
        المكتبة الإعلامية
      </h1>
      <p className="text-gray-600">صفحة المكتبة الإعلامية قيد التطوير...</p>
    </div>
  );
};

export default MediaLibrary;
